css:
@-moz-document domain("workflowy.com") {

/* Board */
.boardCard .name {
	margin-top: -6px
}



.boardColumn {
	flex: 0 0 460px
}
.boardCard {
}
.boardColumn > .name {
	margin: 0 0 0 16px;
}

.boardColumn .boardCard {
	margin: 0 32px 8px 16px;
	max-width: inherit;
}
.boardColumn .project {
	max-width: inherit;
	margin-bottom: 5px;
}
.boardColumn .boardCard .name,
.boardColumn .boardCard .notes {
	max-width: inherit;
}

.boardColumn > .children {
	margin: 0 !important;
}
.boardColumn .boardCard .task {
}
.boardColumn .boardCard .children {
	margin-top: 5px
}

.boardColumn > div:last-child,
.boardColumn .children > div:last-child {
	margin: 0 32px 8px 16px;
}
.boardColumn > .children > .boardCard > .name > .expand {
	left: -2px !important;
}


.boardColumn .collapsed {
	
}
.boardCard .itemMenu {
	z-index: 20;
}




/* Re-style the tags */
.contentTag {
	padding: 2px 3px 2px !important;
	color: #cd003a !important; /* grey by default(#888888)*/
	font-size: 12px !important;
	background: transparent !important;
}

.content .contentTagText,
.project.done .contentTag {text-decoration: none !important;}
.content .contentTag:hover,
.content .contentTag:hover .contentMatch {background-color: #fcb9cc !important;}


/* Lighten links underlining */
.contentLink {
    text-decoration: none !important;
    background-size: 1px 1px;
    background-repeat: repeat-x;
    background-position: 0 1.12em;
    background-image: linear-gradient(to bottom,rgba(0, 0, 0, .2),rgba(255,128,25,0));
}
.contentLink:hover {
    color: #cd003a;
    background-image: linear-gradient(to bottom,rgba(205, 0, 58, .4),rgba(255,128,25,0));
}


/* All done things turn to light grey */
.project.done > .name,
.project.doneAppearance > .name,
.project.done .contentTag,
.project.done .notes > .content,
.project.done .contentLink {
    color: #ccc !important;
    text-decoration: line-through;
    background: none;
}
.project.done {text-decoration: none !important;}
.done .bullet {opacity: .2;}

/* Highlight bold text */
.content > span > b {
    background-color: #fffce0;
    padding: 1px 3px;
    border-radius: 3px;
}
.project.done b {background-color: #fff !important;}



/* Improve search results */
.project.done .contentMatch,
.content .contentMatch {background-color: #ffcedc !important;}
.project.done .contentMatch {
    color: #cd003a !important;
    text-decoration: none !important;
}


/* Canvas */
#documentView { background-color: rgb(42, 49, 53);}
.header { border: none; }

body {
    background-size: cover;
    background-position: center;
    background-attachment: fixed;
    background-image: url('data:image/jpeg;base64,');
}
}
